import React from 'react';
import { Marker, Circle } from '@react-google-maps/api';

const MemoizedGoogleMap = React.memo(({ locations }) => {
  const circleOptions = {
    strokeColor: "#FF0000",
    strokeOpacity: 0.8,
    strokeWeight: 2,
    fillColor: "#FF0000",
    fillOpacity: 0.35,
    clickable: false,
    draggable: false,
    editable: false,
    visible: true,
    radius: 30000,
    zIndex: 1,
  };

  const memoizedLocations = React.useMemo(
    () => locations.filter(Boolean),
    [locations]
  );

  return memoizedLocations.map((item, index) => {
    console.log(locations);
    return (
      <div key={index}>
        <Marker position={item.location} />
        <Circle center={item.location} radius={item.location['lat']*30} options={circleOptions} />
      </div>
    );
  });
});

export { MemoizedGoogleMap };
